import React, { useState } from "react";
import { Box, Drawer, List, ListItem, ListItemButton, ListItemText, Toolbar, AppBar, Typography } from "@mui/material";

const drawerWidth = 240;

const sections = [
  "Home",
  "Store Map and Details",
  "Feedback",
  "Current Problems",
  "Camera Details",
  "Nearby Stores",
  "Profile"
];

const DashboardPage = () => {
  const [selected, setSelected] = useState(0);
  const managerName = "Manager"; // TODO: Replace with actual manager name from auth state

  return (
    <Box sx={{ display: "flex" }}>
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <Typography variant="h6" noWrap component="div">
            Manager Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: "border-box" },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: "auto" }}>
          <List>
            {sections.map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton selected={selected === index} onClick={() => setSelected(index)}>
                  <ListItemText primary={text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, bgcolor: "#f5f5f5", p: 3, minHeight: "100vh" }}>
        <Toolbar />
        <Typography variant="h4" gutterBottom>
          {sections[selected]}
        </Typography>
        {/* Placeholder for section content */}
        <Box>
          {selected === 0 && (
            <div>
              <Typography variant="h5" gutterBottom>
                Welcome, {managerName}!
              </Typography>
              <div>Welcome to the Home section of the dashboard.</div>
            </div>
          )}
          {selected === 1 && <div>Store Map and Details content goes here.</div>}
          {selected === 2 && <div>Feedback content goes here.</div>}
          {selected === 3 && <div>Current Problems content goes here.</div>}
          {selected === 4 && <div>Camera Details content goes here.</div>}
          {selected === 5 && <div>Nearby Stores content goes here.</div>}
          {selected === 6 && <div>Profile content goes here.</div>}
        </Box>
      </Box>
    </Box>
  );
};

export default DashboardPage;
